import React, {useState, useEffect} from 'react';
import {View, TouchableOpacity, Text, TextInput} from 'react-native';

export default function Criacao() {

    const [equipe, setEquipe] = useState({
        "nomeEquipe": "",
        "jogadores": [
            {
                "posicao": "top",
                "jogador": ""
            },
            {
                "posicao": "mid",
                "jogador": ""
            },
            {
                "posicao": "jg",
                "jogador": ""
            },
            {
                "posicao": "adc",
                "jogador": ""
            },
            {
                "posicao": "sup",
                "jogador": ""
            }
        ],
        "nomeCoach": ""

    });


    return(
        <View>
            <Text>Criação de Equipe</Text>
            <TextInput placeholder="Nome da Equipe" id="equipe" />
            <View>
                <Text>Jogadores:</Text>
                <View>
                    <View>
                        <Text>Jogador Top</Text>
                        <TextInput placeholder="Nome do Jogador" id="j1" />
                    </View>
                    <View>
                        <Text>Jogador Mid</Text>
                        <TextInput placeholder="Nome do Jogador" id="j2" />
                    </View>
                    <View>
                        <Text>Jogador Jungler</Text>
                        <TextInput placeholder="Nome do Jogador" id="j3" />
                    </View>
                    <View>
                        <Text>Jogador ADC</Text>
                        <TextInput placeholder="Nome do Jogador" id="j4" />
                    </View>
                    <View>
                        <Text>Jogador Suporte</Text>
                        <TextInput placeholder="Nome do Jogador" id="j5" />
                    </View>
                </View>
            </View>
            <TextInput placeholder="Nome do Coach" id="coach" />
            <TouchableOpacity>
                <Text>Salvar</Text>
            </TouchableOpacity>
        </View>
    )
}
